import {useState} from "react";

const Post = (props) => {
    const [post, setPost] = useState('');
    const fetchPost = () => {
        fetch("/fetchBlogPostById", {
            method: "POST",
            headers: {
                "Content-Type" : "application/json"
            },
            body: JSON.stringify(props.id)
        })
        .then((response) => response.json())
        .then((postResponse) => setPost(post));
    }
    return (
        <>
            <h3>{post.title}</h3>
            <p>{post.email}</p>
            <p>{post.content}</p>
        </>
    )
}
export default Post;
